#https://leetcode.com/problems/substring-with-concatenation-of-all-words

from typing import List

class Solution:
    def findSubstring(self, s: str, words: List[str]) -> List[int]:
        #words 안의 모든 것 중에서 인덱스에 해당하는게 맞는게 있는지 확인

        #s를 인덱스로 매겨서 쭉 한번 진행하면서 확인
        #s[i]중에서 words의 첫번째와 맞는게 있으면 그때부터 단어가 맞는지확인한다.
        #단어가 맞는지 확인이 되면 그건 빼고 나머지 단어중에 맞는게 있는지 확인한다.
        #단어 단위로 확인해야할 필요가 있을까?

        words_len = len(words)
        word_len = 0
        if len(words) > 0:
            word_len = len(words[0]) 

        ans = set([])
        i = 0
        while i < len(s) - (words_len * word_len) + 1:
            subStr = s[i:i+word_len]

            for word in words:
                if subStr == word:
                    subWords = words[0:]
                    subWords.remove(subStr)

                    inputStr = s[i+word_len:i+(word_len*(len(subWords)+1))]
                    if self.checkWindow(inputStr, subWords, word_len) == True:
                        ans.add(i)

                    break
            
            i += 1
        
        return ans


    #첫번째 맞는게 생기면 그 다음 것들이 words에 다 속하는지 확인해야 한다.           
    def checkWindow(self, s: str, words: List[str], word_len: int) -> bool:
        i = 0
        if len(s) < len(words):
            return False
        while i < len(s):
            subStr = s[i:i+word_len]
            for word in words:
                if subStr == word:
                    words.remove(subStr)
                    break
            i += word_len
        
        if len(words) == 0:
            return True
        else:
            return False


